import React from 'react'
import Icon from './Icon'

export default function Item( { title, text, link, icon } ) {
  return (
    <a href={link} target='_blank' className="item-container">
        { icon ? icon : null} 
        <p className="item-title">{title}</p>
        <p className="item-text">{text}</p>
    </a>

  )
}
